  return (
    <StyledFooter>
      <Box sx={{ p: 6, mt: "auto" }} component="footer">
        <Typography variant="body2" color="text.secondary" align="center">
          {"Copyright © "}
          <Link color="inherit" href="#">
            One Call Away
          </Link>{" "}
          {new Date().getFullYear()}
          {"."}
        </Typography>
      </Box>
    </StyledFooter>
  );
};

export default Footer;
